package zakjo.studentsapp.model;public class Govs {    public int id;    public String gov;    public Govs(int id, String gov) {        this.id = id;        this.gov = gov;    }    public Govs() {    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getGov() {        return gov;    }    public void setGov(String gov) {        this.gov = gov;    }}